import React from 'react';
import styled from 'styled-components';

const Poster = styled.div`
  width: 150px;
`;

const MoviePoster = ({ i }) => {
  return (
    <div className="col-md-4">
      <img src={'/img/poster' + (i + 1) + '.jpg'} width="150px" />
    </div>
  );
};

export default MoviePoster;
